import Tester from '../Product/product1.jpg';


function Checkout() {
  const [store] = useStoreContext();

  return (<div id="checkout">
          <hr/>
          <button
						className="btn btn-primary col-1 col-mr-auto"
					>Submit order</button>
    </div>
    );
}

export default Checkout;
